      if (userOptionsId) {
        elements.userOptions.classList.add('showUserOptions');
        elements.userCaretDown.classList.add('hideElement');
      }
    });

    window.addEventListener('mouseup', (e) => {
      const userOptionsId = e.target.closest('#userOptions');
